document.addEventListener('DOMContentLoaded', function () {

  window.dataLayer = window.dataLayer || [];

  function trackEvent(eventName, params = {}) {
    const payload = {
      event: eventName,
      language: document.documentElement.lang || 'en',
      ...params
    };

    // USER ID HANDLING (GA compliant)
    if (window.xenditUser?.id) {
      // logged in
      payload.user_id = window.xenditUser.id;
    } else if (window.xenditUser?.loggedOut === true) {
      // explicit logout
      payload.user_id = null;
    }
    // else: never logged in  do not send user_id

    window.dataLayer.push(payload);
//     console.log('[TRACKED]', payload);
  }

  // Scroll depth
  const thresholds = [25,50,75,90,100];
  const triggered = {};
  window.addEventListener('scroll', () => {
    const percent = Math.round((window.scrollY / (document.body.scrollHeight - window.innerHeight)) * 100);
    thresholds.forEach(th => {
      if (percent >= th && !triggered[th]) {
        triggered[th] = true;
        trackEvent('scroll_tracking', { percent_scroll: th + '' });
      }
    });
  });

  function buildParams(el, keys) {
    const params = {};
    keys.forEach(key => {
      const val = el.dataset[key];
      if (val !== undefined) {
        params[key.replace(/[A-Z]/g, m => '_' + m.toLowerCase())] = val;
      }
    });
    return params;
  }

  // === UNIVERSAL CLICK TRACKER ===
  document.querySelectorAll('[data-track-click]').forEach(el => {
    el.addEventListener('click', () => {
      const eventName = el.dataset.trackClick;
      if (!eventName) return;

      const type = el.dataset.trackType || 'content';

      // PRODUCT CLICK
      if (type === 'product') {
        trackEvent(eventName, buildParams(el, [
          'productName',
          'productCategory',
          'productListSection'
        ]));
        return;
      }

      // CONTENT CLICK
      trackEvent(eventName, buildParams(el, [
        'contentName',
        'contentSection'
      ]));
    });
  });


  // === UNIVERSAL VIEW TRACKER ===
  const viewObs = new IntersectionObserver(entries => {
    entries.forEach(entry => {
      if (!entry.isIntersecting || entry.intersectionRatio < 1) return;

      const el = entry.target;
      const eventName = el.dataset.trackView;
      if (!eventName) return;

      const type = el.dataset.trackType || 'content';

      if (type === 'product') {
        trackEvent(eventName, buildParams(el, [
          'productName',
          'productCategory',
          'productListSection'
        ]));
      } else {
        trackEvent(eventName, buildParams(el, [
          'contentName',
          'contentSection'
        ]));
      }

      viewObs.unobserve(el);
    });
  }, { threshold: 1 });
  document.querySelectorAll('[data-track-view]').forEach(el => viewObs.observe(el));

  // === Footer Country Selector ===
  const footerLinks = document.querySelectorAll('.elementor-location-footer > div > div > div:first-child nav ul li a');
  footerLinks.forEach(link => {
    link.addEventListener(
      'click',
      function (e) {
        const name = link.textContent.trim();
        setTimeout(() => {
          trackEvent('country_selected', {
            content_name: name,
            content_section: 'Footer'
          });
        }, 100);
      },
      true // capture mode
    );
  });

  // --- LIVE CHAT TRACKER (Zendesk Messaging) ---
  function whenZendeskReady(callback) {
    if (typeof zE !== "undefined") {
      callback();
    } else {
      const interval = setInterval(() => {
        if (typeof zE !== "undefined") {
          clearInterval(interval);
          callback();
        }
      }, 300);
    }
  }
  whenZendeskReady(() => {
    try {
      zE('messenger:on', 'open', function() {
        trackEvent('live-chat_clicked', {
          content_name: 'Live Chat',
          content_section: 'Floating'
        });
      });
    } catch (e) {
      console.error('Zendesk messenger not available yet:', e);
    }
  });

  // Page view baseline
  setTimeout(function() {
    trackEvent('page_view', {
      content_name: document.title,
      content_section: window.location.pathname
    });
  }, 300);

  // === Track FAQ view (Elementor Toggle) ===
  document.querySelectorAll('.elementor-widget-toggle .elementor-toggle-item').forEach((item) => {
    const title = item.querySelector('.elementor-tab-title');
    const content = item.querySelector('.elementor-tab-content');
    let tracked = false;

    if (!title) return;

    // Ambil FAQ title dari isi Elementor
    const faqTitle = title.innerText.trim();

    title.addEventListener('click', () => {
      // Elementor butuh 50ms buat set class .elementor-active
      setTimeout(() => {
        const isOpen = title.classList.contains('elementor-active');

        if (isOpen && !tracked) {
          tracked = true;

          trackEvent("view_faq", {
            content_name: faqTitle,
            content_section: "FAQ"
          });

          //console.log("[TRACKED] FAQ viewed:", faqTitle);
        }
      }, 50);
    });
  });

  // === DYNAMIC POST TRACKING (VIEW + CLICK PER ITEM) ===
  (function() {

    // STEP 1  Copy widget-level attributes  into each individual post
    document.querySelectorAll(
      '.elementor-widget-posts, ' +
      '.elementor-widget-archive-posts, ' +
      '.elementor-widget-xendit-posts-archive, ' +
      '.elementor-widget-xendit-related-posts, ' +
      '.elementor-widget-xendit-events-archive'
    ).forEach(widget => {

      const viewEvent  = widget.dataset.trackViewEvent;
      const clickEvent = widget.dataset.trackClickEvent;
      const section    = widget.dataset.contentSection || '';

      if (!viewEvent && !clickEvent) return;

      // Posts inside widget
      widget.querySelectorAll('.elementor-post, .archive-item').forEach(post => {
        if (viewEvent)  post.dataset.trackViewEvent = viewEvent;
        if (clickEvent) post.dataset.trackClickEvent = clickEvent;
        if (section)    post.dataset.contentSection = section;
      });
    });

    // STEP 2  Extract title inside post item
    function getPostTitle(postEl) {
      return (
        postEl.querySelector('.elementor-heading-title a')?.innerText?.trim() ||
        postEl.querySelector('.elementor-post__title a')?.innerText?.trim() ||
        postEl.querySelector('h2 a')?.innerText?.trim() ||
        postEl.querySelector('h3 a')?.innerText?.trim() ||
        ''
      );
    }

    // STEP 3  CLICK TRACKING
    document.querySelectorAll('.elementor-post, .archive-item').forEach(post => {
      const eventName = post.dataset.trackClickEvent;
      if (!eventName) return;

      post.addEventListener('click', () => {
        const title = getPostTitle(post);
        const section = post.dataset.contentSection || '';

        trackEvent(eventName, {
          content_name: title,
          content_section: section
        });
      });
    });

    // STEP 4  VIEW TRACKING
    const viewObserver = new IntersectionObserver(entries => {
      entries.forEach(entry => {
        if (!entry.isIntersecting || entry.intersectionRatio < 1) return;

        const post = entry.target;
        const eventName = post.dataset.trackViewEvent;
        if (!eventName) return;

        const title = getPostTitle(post);
        const section = post.dataset.contentSection || '';

        trackEvent(eventName, {
          content_name: title,
          content_section: section
        });

        viewObserver.unobserve(post);
      });
    }, { threshold: 1 });

    document.querySelectorAll('.elementor-post[data-track-view-event], .archive-item[data-track-view-event]')
      .forEach(post => viewObserver.observe(post));

  })();

  // === BLOG CONTENT LINK TRACKING ===
  // Trigger untuk semua link dalam blog content editor
  (function() {
    const blogContent = document.querySelector('.elementor-widget-theme-post-content, .post-content, .entry-content');

    if (!blogContent) return;

    blogContent.addEventListener('click', function(e) {
      const link = e.target.closest('a');
      if (!link) return;

      const anchorText = link.innerText.trim() || link.getAttribute('href');

      trackEvent('blog_link_clicked', {
        content_name: anchorText.substring(0, 120), // biar ga kepanjangan
        content_section: 'Blog Text'
      });
    });

  })();

  // pardot form tracker	  
  window.addEventListener('message', function(event) {
    if (!event.data || typeof event.data !== 'object') return;
    if (event.data.event !== 'pardot_form_submit') return;

    const formName = event.data.formName || '';

    // gunakan trackEvent dari base tracker
    if (typeof trackEvent === 'function') {
      trackEvent('lead_created', {
        method: 'Contact Sales',
        pardot_form_name: formName
      });
    } else {
      console.warn('trackEvent() belum tersedia saat postMessage diterima');
    }
  });

});
